import React, { Component } from 'react';
import { Typography } from '@material-ui/core';
import Paper from '@material-ui/core/Paper';
import StarBorderOutlinedIcon from '@material-ui/icons/StarBorderOutlined';
import NavigateNextIcon from '@material-ui/icons/NavigateNext';
import Button from '@material-ui/core/Button';

const styles = { paper: {
                
                paddingTop:20,
                backgroundColor: '#fafaff'
               },
            DailyGoal: {
                  color: "#112647"
               },
            Goal: {
                    paddingBottom: 50 ,  
                    color: "#231f59"
                },
            Star : {
                  color: "#e0d124"
                },
            NextButton : {
                backgroundColor: '#112647',
                marginRight: auto
            },
            NextButtonIcon : {
                color: "#e0d124"
            }

            }

class DailyGoal extends Component {
    render() {
        let goal =this.props.goal.body;
        return (
            <div>
                <Paper style={styles.paper} square>
                    <Typography variant="h3" style={styles.DailyGoal}>Daily Goal</Typography>
                    <br></br>
                    <div style={styles.Star}>
                        <StarBorderOutlinedIcon></StarBorderOutlinedIcon><StarBorderOutlinedIcon></StarBorderOutlinedIcon><StarBorderOutlinedIcon></StarBorderOutlinedIcon>
                    </div>
                  
                    <br></br>
                    <Typography variant="h2" style={styles.Goal} >{goal}</Typography>
                    <Button style={styles.NextButton}>
                        <NavigateNextIcon style={styles.NextButtonIcon}></NavigateNextIcon>
                    </Button>
                </Paper>
            </div>
        )
    }
}

export default DailyGoal
